com.mirth.connect.plugins.javascriptstep.script:
var raw = connectorMessage.getRawData();
logger.info("Datos recibidos: " + raw); // Esto saldr√° en la consola de Mirth
var msg = JSON.parse(raw);

var patient = {
	id: msg['id'],
	identifier: [{
		use: 'usual',
		type: {
			coding: [{
				system: 'http://terminology.hl7.org/CodeSystem/v2-0203',
				code: "MR"
			}]
		},
		system: 'urn:oid:1.2.36.146.595.217.0.1',
		value: msg['documento_identidad']
	},
	{
		use: 'secondary',
		value: msg['order']
	}
	],
	active: true,
	name: [{
		use: "official",
		family: msg['apellido'],
		given: [msg['nombre']]
	}],
	gender: msg['genero'],
	birthday: msg['fecha_nacimiento'],
	photo: 'data:image/webp;base64,'
};


channelMap.put('fhirResource', JSON.stringify(patient, null, 2));
channelMap.put('order', '0000' + patient.identifier[1].value);
msg = patient;

